import React from 'react'

const HotelCard = ({guest}) => {
    return (
        <>

        <h1>Name: {guest.name}</h1>
        <h1>Email: {guest.email}</h1>
        <h1>Checked-In? {guest.checkedIn}</h1>

        </>
    )
}

export default HotelCard
